import React from 'react';
import {
  Routes,
  Route,
  BrowserRouter,
} from 'react-router-dom';
import Homepage from './pages/Homepage';
import './style.css';

function App() {
  return (
    <div className="App">
      <div className="chat-notification text-red">
        <div className="chat-notification-content">
          <h4 className="chat-notification-title  text-red">ChitChat</h4>
          <p className="chat-notification-message  text-red">You have a new message!</p>
        </div>
      </div>

      <BrowserRouter>
        <Routes>

          <Route path="/" element={<Homepage/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
